window.QRCode={toCanvas:function(c,t,o,cb){try{var x=c.getContext('2d');x.clearRect(0,0,c.width,c.height);x.fillStyle='#111827';x.fillRect(0,0,c.width,c.height);x.fillStyle='#10b981';x.font='bold 14px sans-serif';x.fillText('QR (stub)',10,20);x.fillStyle='#fff';x.font='11px sans-serif';var p=(t+'').match(/.{1,22}/g)||[t];for(var i=0;i<Math.min(7,p.length);i++){x.fillText(p[i],10,40+i*14);}if(cb)cb();}catch(e){if(cb)cb(e);}}};
